        data=> {
          SetData(data)
          console.log("data",data)


        }
    )
  }, [])

  const [email, setEmail] = useState('');

  const handleSubmit = (event) => {
      event.preventDefault();
      // ... do something with email
  }

  return (
    <div>
      <h1>{data.nombre}</h1>
      <input type="text" id="name" name="name"  />
      <form onSubmit={handleSubmit}>
